import './Admin.css'
import React from 'react';
import {ProjectCards} from './ProjectCardAdmin'
const Dashboard = () => {
  return (
    <div>
      <div className="cont">
      <h2>Welcome to the Admin Dashboard</h2>
      <p>This area is only accessible to authorized users.</p>
      </div>
        <ProjectCards/>
    </div>
  );
};

export default Dashboard;
